import React, { useState, useEffect } from 'react';
import useCategories from './useCategories';
import useModals from './useModals';
import './App.css';
import CircularMeter from './CircularMeter';
import Modal from './Modal';
import AddCategoryModal from './AddCategoryModal';
import EditCategoryModal from './EditCategoryModal';
import AddSubtractModal from './AddSubtractModal';

function App() {
  const {
    showAddCategoryModal,
      showSubtractModal,
      showEditModal,
      showAddSubtractModal,
      currentCategoryId,
      currentSign,
      handleOpenAddCategoryModal,
      handleCloseAddCategoryModal,
      handleOpenEditModal,
      handleCloseEditModal,
      handleOpenAddSubtractModal,
      handleCloseAddSubtractModal
  } = useModals();

  const {
    categories,
    totalMaxValue,
    totalValue,
    addCategory,
    changeValues,
    deleteCategory,
    addSubtracAmount
  } = useCategories();

  return (
    <div className="App">
      <h1>Conscience Spending Plan</h1>

      <div className='category'>
        <div className='category-item'>
          <h2>Total</h2>
          <CircularMeter value={totalValue} maxValue={totalMaxValue} />
          <p>${totalValue} / {totalMaxValue}</p>
        </div>

        {categories.map((category) => (
          <div key={category.id} className='category-item'>
            <h2>{category.name}</h2>
            <CircularMeter value={category.value} maxValue={category.maxValue} />
            <p>${category.value} / {category.maxValue}</p>
            <div className='btn-container'>
              <div className='plus-minus'>
              <button onClick={() => handleOpenAddSubtractModal(category.id, '-')}>-</button>
              <button onClick={() => handleOpenAddSubtractModal(category.id, '+')}>+</button>
              </div>
              <button className='btn-edit' onClick={() => handleOpenEditModal(category.id)}>Edit</button>
            </div>
          </div>
        ))}
      </div>

      <button onClick={handleOpenAddCategoryModal} className='add-category'>Add Category</button>

      <AddCategoryModal show={showAddCategoryModal} handleClose={handleCloseAddCategoryModal} addCategory={addCategory} />
      <EditCategoryModal show={showEditModal} handleClose={handleCloseEditModal} changeValues={changeValues} deleteCategory={deleteCategory} currentCategoryId={currentCategoryId}/>
      <AddSubtractModal show={showAddSubtractModal} handleClose={handleCloseAddSubtractModal} addSubtractAmount={addSubtracAmount} sign={sign}/>

      {/* Modal for adding an amount to a category */}
      <Modal show={showAddModal} handleClose={handleCloseAddModal}>
        <h2>Add Amount</h2>
        <form onSubmit={(e) => {
          e.preventDefault();
          const addValue = parseFloat(e.target.addValue.value); // Get the value to add
          editAmount(currentCategoryId, addValue);
          e.target.reset();
        }}>
          <div className='info'>
            <label>
              Amount: 
              <input type='number' name='addValue' min='0.01' max='100000' step='0.01' required />
            </label>
          </div>
          <div className='modal-btns'>
            <button type='submit'>Add</button>
          </div>
        </form>
      </Modal>

      {/* Modal for subtracting an amount to a category */}
      <Modal show={showSubtractModal} handleClose={handleCloseSubtractModal}>
        <h2>Subtract Amount</h2>
        <form onSubmit={(e) => {
          e.preventDefault();
          const subtractValue = parseFloat(e.target.subtractValue.value) * -1; // Get the value to add
          editAmount(currentCategoryId, subtractValue);
          e.target.reset();
        }}>
          <div className='info'>
            <label>
              Amount: 
              <input type='number' name='subtractValue' min='0.01' max='100000' step='0.01' required />
            </label>
          </div>
          <div className='modal-btns'>
            <button type='submit'>Subtract</button>
          </div>
        </form>
      </Modal>
    </div>
  );
}

export default App;
